export default function Sidenav(){
   const crte = '//';
   return (
      <div className="sidenav" > 
         <ul className="nav__links">
            <li className="razmak"><a href="pocetak" ><span>{crte}</span>  O nama</a></li>
            <li className="razmak"><a href="pocetak" ><span>{crte}</span>  Proizvodi</a></li>
            <li className="razmak"><a href="pocetak"><span>{crte}</span>  O kamenu</a></li>
            <li className="razmak"><a href="pocetak"><span>{crte}</span>  Kontakt</a></li>
         </ul> 
      </div>
   )
}
